import React from 'react'
import { motion } from 'framer-motion'

export default function Home() {
  return (
    <section className="bg-blue-50 min-h-screen flex items-center justify-center p-8">
      <motion.div
        className="text-center max-w-2xl"
        initial={{ opacity: 0, y: 40 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8, ease: 'easeOut' }}
      >
        <motion.h1
          className="text-5xl font-bold text-blue-800 mb-6"
          initial={{ scale: 0.8 }}
          animate={{ scale: 1 }}
          transition={{ delay: 0.4, duration: 0.6 }}
        >
          Welcome to NexetLab
        </motion.h1>
        <motion.p
          className="text-lg text-gray-700 mb-6"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.6 }}
        >
          We build modern software and websites that drive your business
          forward.
        </motion.p>
        <motion.a
          href="/services"
          className="inline-block bg-blue-700 text-white px-6 py-3 rounded font-semibold hover:bg-blue-800 transition"
          whileHover={{ scale: 1.05 }}
        >
          Explore Services
        </motion.a>
      </motion.div>
    </section>
  )
}
